input="""



"""

array = input.split("\n")
answer = []

# 1 2 3
# 4 5 6
# 7 8 9
pad = [[1,2,3],[4,5,6],[7,8,9]]

# up [-1,0]
# down [+1,0]
# left [0,-1]
# right [0,+1]

# start at 5
current = [1,1]

for move in array:
	for letter in move:

		# Make sure you dont try to go outside the pad
		if letter == "U" and current[0]>0:
			current = [current[0]-1,current[1]]
		if letter == "D" and current[0]<2:
			current = [current[0]+1,current[1]]
		if letter == "L" and current[1]>0:
			current = [current[0],current[1]-1]
		if letter == "R" and current[1]<2:
			current = [current[0],current[1]+1]

	answer.append(pad[current[0]][current[1]])

#Answer 
print(answer)
